import Footer from "./components/Footer";
import Header from "./components/Header";
import Section1 from "./components/TeachWithUs/Section1";
import Section2 from "./components/TeachWithUs/Section2";

export default function TeachWithUs() {
    return (
        <>
            <Header selectedMenu="TeachWithUs" />
            <Section1 />
            <div className="text-center p-5">
                <img style={{ maxWidth: '1000px', width: '100%' }} src="data:image/jpeg;base64," alt="#ImgNotFound" />
            </div>
            <Section2 />
            <Footer />
        </>
    )
}
